import React, { Component } from 'react';
import JSON from '../services/data';

class Weather extends Component {
  constructor(props) {
    super(props);
    this.teste = this.teste.bind(this);
  }

  teste() {
    JSON.map((dataID) => {
      console.log(dataID.id)
      return(
        <div key={dataID.name}>
          <p>{`${dataID.name} ${dataID.id}`}</p>
        </div>
      )
    })
  }
  render() {
    return (
      <div>
        hello
        {this.teste()}
      </div>
    )
  }
}

export default Weather;
